import uuid from "react-uuid";

function assignUuid(item) {
  item.uuid = uuid();
  if (item?.submenu) {
    item.submenu.forEach((subItem) => assignUuid(subItem));
  }
}

export function getNavItems() {
  const navItems = [
    {
      name: "Who I am",
      submenu: [
        {
          name: "About Me",
      }
      ],
    },
    {
      name: "My Work",
      submenu: [],
    },
  ];
  navItems.forEach((item) => assignUuid(item));
  return navItems;
}
